import React from 'react';
import "./About.css";

const About = () => {
    return ( <div className="about">
        <div className="right">
            <h1>ABOUT ME</h1>
        </div>
        <div className="left">
            <h1>I'M A SOHAIB HASSAN</h1>
        </div>
    </div> );
}
 
export default About;
